SQL_STMT_U.val:
select *
from (SELECT  d.ID, d.FUCA_ID, d.LETY_ID, d.DEDU_ID, d.HAS_EXEMPTION, f.REPORT_DESCRIPTION AS DEDU_DESCRIPTION, l.DESCRIPTION AS LETY_DESCRIPTION  FROM fundcategory_deductions d, deduction_definition f, legalentity_type l where FUCA_ID = ~1  and d.DEDU_ID = f.ID and d.LETY_ID = l.ID order by ID)
:2
